import React from 'react';
import { 
    IonBackButton,
    IonButtons,
    IonHeader,
    IonTitle,
    IonToolbar
} from '@ionic/react';
import { returnUpBack } from 'ionicons/icons';


const SettingsTopBar: React.FC = () => (
    <IonHeader>
        <IonToolbar>
            <IonTitle>Settings</IonTitle>
            <IonButtons slot="end">
                <IonBackButton text="" icon={returnUpBack}></IonBackButton>
            </IonButtons>
        </IonToolbar>
    </IonHeader>
)

export default SettingsTopBar;
